import { useState } from "react";
import VideoCapture from "../../Components/GuestPage/VideoSection/VideoCapture";
import Navbar from "../../Components/Navbar/Navbar";
import Card from "../../Components/AddPerson/Card";
import PresentList from "../../Components/GuestPage/ListPresent/PresentList";

function GuestPage() {
  const [showCard, setShowCard] = useState(false);
  const [isConnected, setIsConnected] = useState(false);

  return (
    <div className="GuestPage">
      <Card showCard={showCard} onToggleCard={setShowCard} />
      <div className="Hidder"></div>
      <div className="TheTwoFriends">
        <PresentList
          isConnected={isConnected}
          setIsConnected={setIsConnected}
        />
        <VideoCapture isConnected={isConnected} />
      </div>
    </div>
  );
}

export default GuestPage;
